@loader.tds
class DemoterMod(loader.Module):
	"""Демотиваторы"""
	strings = {
		"name": "Demoter"
	}

	async def client_ready(self, client, db):
		self.client = client

	async def demotcmd(self, message):
		start = datetime.now()
		text = utils.get_args_raw(message)
		if not text:
			await message.edit('<b>ТЕКСТА-ТО НЕТ АЛО</b>')
			return
		if message.is_reply:
			reply = await message.get_reply_message()
			data = await check_media(reply)
			if isinstance(data, bool):
				message.edit('<b>РЕПЛАЙ НА ФОТО ИЛИ СТИКЕР</b>')
				return
		else:
			message.edit('<b>РЕПЛАЙ НА ФОТО ИЛИ СТИКЕР</b>')
			return
		image = io.BytesIO()
		await message.client.download_media(data, image)
		image = Image.open(image)
		image = await demot(text, image)
		end = datetime.now()
		duration = (end - start).microseconds / 1000
		await message.edit(f"Сделано за {duration}мс")
		fried_io = io.BytesIO()
		fried_io.name = "image.jpeg"
		image.save(fried_io, "JPEG")
		fried_io.seek(0)
		await message.client.send_file(message.chat_id, fried_io, reply_to=reply.id)
		await sleep(2)
		await message.delete()


